pragma solidity ^0.4.0;

import "./Amendable.sol";

/**
 * Mark usage documentation
 */
contract UsageDocument is Amendable {


    string private geographicRegion; // TODO think about this
    uint private classOfGoods;
    uint private dateOfFirstUse; // unix timestamp
    bytes32 private proofOfUse;
    string private details;
    // TODO add usage description (tags) information

    function UsageDocument_v1(string _geographicRegion,
                              uint _classOfGoods,
                              uint _dateOfFirstUse,
                              bytes32 _proofOfUse,
                              string _details) {
        geographicRegion = _geographicRegion;
        classOfGoods = _classOfGoods;
        dateOfFirstUse = _dateOfFirstUse;
        proofOfUse = _proofOfUse;
        details = _details;
    }


    // Restricted getters
    //-------------------

    function getGeographicRegion() external constant restricted returns (string) {
        return geographicRegion;
    }
    function getClassOfGoods() external constant restricted returns (uint) {
        return classOfGoods;
    }
    function getDateOfFirstUse() external constant restricted returns (uint) {
        return dateOfFirstUse;
    }
    function getProofOfUse() external constant restricted returns (bytes32) {
        return proofOfUse;
    }
    function getDetails() external constant restricted returns (string) {
        return details;
    }
}
